import { Component, OnInit, ViewChild } from '@angular/core';
import { MatDialog } from '@angular/material/dialog';
import { MatPaginator } from '@angular/material/paginator';
import { MatSnackBar, MatSnackBarRef, SimpleSnackBar } from '@angular/material/snack-bar';
import { MatTableDataSource } from '@angular/material/table';
import { ConfirmComponent } from 'src/app/modules/shared/components/confirm/confirm.component';
import { CategoryService } from 'src/app/modules/shared/services/category.service';
import { NewCategoryComponent } from '../new-category/new-category.component';

@Component({
  selector: 'app-combinacion',
  templateUrl: './combinacion.component.html',
  styleUrls: ['./combinacion.component.css']
})
export class CombinacionComponent implements OnInit{

  constructor(private categoryService: CategoryService,
              public dialog: MatDialog, private snackBar: MatSnackBar){ }

  ngOnInit(): void {
    this.getComparacion();
  }

  displayedColumns: string[] = ['id_comparacion','archivoNombreAarchivoNombreB','version','id_ArchivoA','fecha_inicio',
    'creador','estadoArchivoB','porcentajeIgualAB','porcentajeAnotB','porcentajeBnotA'];
  dataSource = new MatTableDataSource<CombinancionElement>();

  @ViewChild(MatPaginator)
  paginator!: MatPaginator;

  getComparacion(){

    this.categoryService.getCategories()
    .subscribe( (data:any) =>{

      console.log("respuesta archivos: ", data);
      this.processCategoriesResponse(data);

    }, (error:any) => {
      console.log("error: ", error);
    })
  }

  processCategoriesResponse(resp: any){
    const dataCategory: CombinancionElement[] = [];
      let listCategory = resp.body;
      listCategory.forEach((element: CombinancionElement) => {
        dataCategory.push(element);
      });
      this.dataSource = new MatTableDataSource<CombinancionElement>(dataCategory);
      this.dataSource.paginator = this.paginator;
  }

  openCategoryDialog(){
    const dialogRef = this.dialog.open(NewCategoryComponent, {
      width:'500px'
    });

    dialogRef.afterClosed().subscribe((result:any) => {
      
      if(result==1){
        this.openSnackBar("Combinación Agregada","Exito");
        this.getComparacion();
      }else if(result==2){
        this.openSnackBar("Se produjo un error al guardar la comparación", "Error");
      }
    });
  }

  edit(id:number, name: string, descripcion: string){
    const dialogRef = this.dialog.open(NewCategoryComponent, {
      width:'500px',
      data:{id: id, name: name, descripcion: descripcion}
    });

    dialogRef.afterClosed().subscribe((result:any) => {
      
      if(result==1){
        this.openSnackBar("Combinación Actualizada","Exito");
        this.getComparacion();
      }else if(result==2){
        this.openSnackBar("Se produjo un error al actualizar la comparación", "Error");
      }
    });
  }

  delete(id:any){
    const dialogRef = this.dialog.open(ConfirmComponent, {
      data:{id: id}
    });

    dialogRef.afterClosed().subscribe((result:any) => {
      
      if(result==1){
        this.openSnackBar("Combinación eliminada","Exito");
        this.getComparacion();
      }else if(result==2){
        this.openSnackBar("Se produjo un error al eliminar la comparación", "Error");
      }
    });
  }

  buscar(termino:string){
    if(termino.length === 0){
      return this.getComparacion();
    }else{
      this.categoryService.getCategorieById(termino)
          .subscribe((resp:any)=>{
            this.processCategoriesResponse(resp);
          })
    }
  }

  openSnackBar(message: string, action:string) : MatSnackBarRef<SimpleSnackBar>{
    return this.snackBar.open(message, action, {
      duration: 2000
    })
  }



}

export interface CombinancionElement{
    id_comparacion: number;
    archivoNombreAarchivoNombreB: string;
    descripcionArchivo: string;
    id_ArchivoA: number;
    fecha_inicio: Date;
    creador: string;
    estadoArchivoB: boolean;
    version: string;
    porcentajeIgualAB: number;
    porcentajeAnotB: number;
    porcentajeBnotA: number;
}
<mat-card style="background: #eee6e6; color: black;">

    <h2 class="alinear">Listado de Comparaciones</h2>
    <mat-card-header>
        <div>
            <mat-form-field hintLabel="Busque la comparacion" appearance="fill" >
                <mat-label>Buscar comparación</mat-label>
                <input matInput #input (keyup)="buscar(input.value)">

            </mat-form-field>
        </div>
    </mat-card-header>
    <mat-card-header>
        <div fxFlex fxLayout="row" fxLayoutAlign="flex-end">
            <ul fxLayout="row" fxLayoutGap="20px">
                <li>
                    <button mat-raised-button style="background: blue;" (click)="openCategoryDialog()">Agregar Comparación</button>
                </li>
            </ul>

        </div>
    </mat-card-header>

    <div mat-card-image></div>

    <mat-card-content style="background: #eee6e6; color: black;">
        <table mat-table [dataSource]="dataSource" class="mat-cell" >

            <!-- name column -->
            <ng-container matColumnDef="id_comparacion">
                <th mat-header-cell *matHeaderCellDef> Twins Id</th>
                <td mat-cell *matCellDef="let element"> {{ element.id_comparacion}}</td>
            </ng-container>

            <!-- description column -->
            <ng-container matColumnDef="archivoNombreAarchivoNombreB">
                <th mat-header-cell *matHeaderCellDef> Twins Name </th>
                <td mat-cell *matCellDef="let element"> {{ element.archivoNombreAarchivoNombreB}}</td>
            </ng-container>

            <!-- id column-->
            <ng-container matColumnDef="version">
                <th mat-header-cell *matHeaderCellDef> Twins Version </th>
                <td mat-cell *matCellDef="let element"> {{ element.version}}</td>
            </ng-container>

            <!-- Created At column-->
            <ng-container matColumnDef="id_ArchivoA">
                <th mat-header-cell *matHeaderCellDef> Execution Id </th>
                <td mat-cell *matCellDef="let element"> {{ element.id_ArchivoA}}</td>
            </ng-container>

            <!-- Created By column-->
            <ng-container matColumnDef="fecha_inicio">
                <th mat-header-cell *matHeaderCellDef> Executed At </th>
                <td mat-cell *matCellDef="let element"> {{ element.fecha_inicio}}</td>
            </ng-container>

            <!-- Updated At column-->
            <ng-container matColumnDef="creador">
                <th mat-header-cell *matHeaderCellDef> Executed Creator </th>
                <td mat-cell *matCellDef="let element"> {{ element.creador}}</td>
            </ng-container>

            <!-- Version column-->
            <ng-container matColumnDef="estadoArchivoB">
                <th mat-header-cell *matHeaderCellDef> Execution Status </th>
                <td mat-cell *matCellDef="let element"> {{ element.estadoArchivoB}}</td>
            </ng-container>

            <!-- id column-->
            <ng-container matColumnDef="estado">
                <th mat-header-cell *matHeaderCellDef> State </th>
                <td mat-cell *matCellDef="let element"> {{ element.estado}}</td>
            </ng-container>

             <!-- id column-->
             <ng-container matColumnDef="porcentajeIgualAB">
                <th mat-header-cell *matHeaderCellDef> A=B </th>
                <td mat-cell *matCellDef="let element"> {{ element.porcentajeIgualAB}}</td>
            </ng-container>

             <!-- id column-->
             <ng-container matColumnDef="porcentajeAnotB">
                <th mat-header-cell *matHeaderCellDef> A not B </th>
                <td mat-cell *matCellDef="let element"> {{ element.porcentajeAnotB}}</td>
            </ng-container>

            <!-- id column-->
            <ng-container matColumnDef="porcentajeBnotA">
                <th mat-header-cell *matHeaderCellDef> B not A </th>
                <td mat-cell *matCellDef="let element"> {{ element.porcentajeBnotA}}</td>
            </ng-container>

            <!-- actions-->
            <ng-container matColumnDef="actions">
                <th mat-header-cell *matHeaderCellDef> Acciones </th>
                <td mat-cell *matCellDef="let element; let i=index;">

                    <button mat-icon-button color="accent"(click)="edit(element.id, element.name, element.descripcion)">
                        <mat-icon aria-label="Edit">edit</mat-icon>
                    </button>

                    <button mat-icon-button color="accent" (click)="delete(element.id)">
                        <mat-icon aria-label="Delete">delete</mat-icon>
                    </button>
                </td>

            </ng-container>

            <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
            <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>

        </table>

        <mat-paginator [pageSizeOptions]="[5, 10, 20]" showFirstLastButtons></mat-paginator>

    </mat-card-content>

</mat-card>
